(function(){"use strict";self.onmessage=e=>{const{txData:s}=e.data;try{if(!(s!=null&&s.trim())){self.postMessage({error:null,tx:null});return}const r=JSON.parse(s);if(!r.to||!r.value||!r.data||!Array.isArray(r.signatures))throw new Error("Invalid transaction format");self.postMessage({error:null,tx:r})}catch(r){self.postMessage({error:r instanceof Error?r.message:"Invalid transaction data",tx:null})}}})();
